text:
{'text': 'Thank god this small hill range hemmed by high rises has been preserved. An oasis of greenery with a little bit of a climb makes this a must go if you want to do some shinrin-yoku (or forest bathing).

You have options of a rugged forest trail along the ground or a milder metallic trail along the treetops that’s good for children & seniors too. Gentle climbs and connectivity to Kent Ridge on one side and Henderson + MtFaber on the other allows you to stretch your hike if you feel like.

Deep greenery and cool breezes surprise you on every bend and if you keep an eye out you will see many more natural treasures', 'languageCode': 'en'}

